import { useRef } from 'react'
import classes from './SearchForm.module.css'

const SearchForm = () => {

    const inputRef = useRef();

    return (
        <form className={classes.form}>
            <div>
                <label id="house" htmlFor="house">Find Properties</label>
                <input ref={useRef} type="text" placeholder="search by location" />
            </div>
        </form>
    )
}

export default SearchForm
